const Card = ({CardContent}) => {
console.log({CardContent});
    return (
        <div className="Card">
           <h1 className="CardTitle">{CardContent.title}</h1>
           <h1 className="CardBody">{CardContent.body}</h1>
           <h1 className="CardImage">Card Image</h1>
           <h1 className="CardLink">Card Link</h1>
        </div>
    );
}

export default Card;
